import React, {useState} from "react";
import {listDecks} from "../../utils/api/index"

async function Deck(){

  const decks=listDecks()
  //console.log(decks)
  const deckSet = await Promise.resolve(decks)

  const result = deckSet.map(deck => (
      <div className="card">
        <div className="card-body">
          <h3 className="card-title">
            {deck.name}
          </h3>
          <p className="card-text">
            {deck.description}
          </p>
        </div>
      </div>
  ));
  return(
    <>
      {result}
    </>
  )
}


export default Deck;
